contracts/Colhoz.sol.content:
// SPDX-License-Identifier: Unlicense


pragma solidity ^0.8.0;


struct User{
    address userAddr;
    string login;
    string password;
    string fio;
    string status;
}


struct Seller{
    address userAddr;
    string login;
    string password;
    string fio;
    string status;
    string shopId;
}

struct Shop{
    string shopId;
    address shopAddr;
    string number;
    string city;
}

struct Review{
    address autor;
    string message;
    string shopId;
    address[] likes;
    address[] dislikes;
}

struct Request{
    address autor;
    string currentRole;
    string desiredRole;
}

contract Colhoz{

    address public provider;
    address public bank;

    User[] buyers;

    User[] admins;

    Seller[] sellers;

    Shop[] shops;

    Review[] reviews;

    Request[] requests;



    function set_provider(address _provider) public {
        provider = _provider;
    }

    function set_bank(address _bank) public {
        bank = _bank;
    }


    function get_buyers() public view returns(User[] memory){
        return buyers;
    }

    function add_buyer(User memory user) public {
        buyers.push(user);
    }

    function remove_buyer(uint index) public {
        delete buyers[index];
    }

    function update_buyer(uint index,User memory user) public {
        buyers[index] = user;
    }

    function add_admin(User memory admin) public {
        admins.push(admin);
    }

    function delete_admin(uint index) public {
        delete admins[index];
    }

    // function set_sellers(Seller[] memory _sellers) public {
    //     sellers = _sellers;
    // }

    // function set_shops(Shop[] memory _shops) public {
    //     shops = _shops;
    // }

    // function set_reviews(Review[] memory _reviews) public {
    //     reviews = _reviews;
    // }

    // function set_requests(Request[] memory _requests) public {
    //     requests = _requests;
    // }
}

